import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  template: `
    <div class="navbar">
     
     <div class="navbar-brand">
       
       <a class="navbar-item">
         MY LOGO
       </a>
       
     </div>
     <div class="navbar-menu">
       
       <a class="navbar-item" routerLink="/">Home</a>
       <a class="navbar-item" routerLink="/user">user</a>
     </div>
   </div>
  `,
  styles: [
    `
    .navbar {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 20px;
      background-color: teal;
      color: #fff;
    }

    .navbar-item{
      margin = 10px;
    }
    
    `,
  ]
})
export class HeaderComponent {

}
